import React from 'react'

function NavItem({Icon,title,Avatar}) {
    return (
        <div class="navitem">
            {Icon && <Icon className="icon"/>}
            {Avatar && <Avatar className="avatar"/>}
            spa
        </div>
    )
}

export default NavItem
